import React, { Component } from 'react'
import './style.css'

class Jumbotron extends Component {

    state = {
        title:[],
        description: [],
        appLink: [],
        ghLink: []
    }


    render() {
        return (
           <div className='ui container'>
            <div className="jumbotron" >
                <h1 className="title">Hello, world!</h1>
                <p className="description">This is a simple hero unit, a simple jumbotron-style component for calling extra attention to featured content or information.</p>
                <hr className="my-4"/>
                    <p>Check it out for yourself!</p>
                    <a className="btn btn-primary btn-lg link" href="github.com" role="button">Learn more</a>
            </div>
            </div>
                )
            }
}

export default Jumbotron;
